import React from 'react';
import "./Header.css"
import { FiShoppingCart, FiHeart, FiUser  } from "react-icons/fi";

function Header() {
    return (
      <header className="header">
        <nav>
          <ul>
            <li>Home</li>
            <li>Game Store</li>
            <li>News</li>
          </ul>
        </nav>
        <div className="icons">
          <i><FiShoppingCart/></i>
          <i><FiHeart/></i>
          <i><FiUser/></i>
        </div>
      </header>
    );
  }
  
  export default Header;
